import { makeStyles } from '@material-ui/core/styles';

export default makeStyles(() => ({
    main: {
        // maxWidth: 345, original width style
        marginTop: "10rem",
        maxWidth: '100%',
        color: 'black',
        margin: 'auto',
        paddingBottom: '50px',
        border: '2px solid black'
    },
    image: {
        flex: 1,
        width: null,
        height: null,
        resizeMode: 'contain'
    }
}));
